package com.leetcode.easy.top.array;

import java.util.HashMap;
import java.util.Map;

public class _242_Valid_Anagram {
    //https://leetcode.com/problems/valid-anagram/description/
    //242. Valid Anagram

    static public boolean isAnagram(String s, String t) {
        Map<Character, Integer> s1 = new HashMap<>();
        Map<Character, Integer> s2 = new HashMap<>();

        for (Character ch : s.toCharArray()) {
            s1.put(ch, s1.getOrDefault(ch, 0) + 1);
        }

        for (Character ch : t.toCharArray()) {
            s2.put(ch, s2.getOrDefault(ch, 0) + 1);
        }

        if (s1.size() != s2.size()) return false;

        for (var entry : s1.entrySet()) {
            if (!entry.getValue().equals(s2.get(entry.getKey()))) return false;
        }

        return true;
    }

    public boolean isAnagram1(String s, String t) {
        int[] map = new int[26];
        for (char ch : s.toCharArray()) map[ch - 'a']++;
        for (char ch : t.toCharArray()) map[ch - 'a']--;
        for (int n : map) if (n != 0) return false;
        return true;
    }

    public boolean isAnagram2(String s, String t) {
        if (s.length() != t.length()) return false;
        int[] s1 = new int[26];
        int[] s2 = new int[26];
        for (char ch: s.toCharArray()) s1[ch - 'a']++;
        for (char ch: t.toCharArray()) s2[ch - 'a']++;
        for (int i = 0; i < s1.length; i++) if (s1[i] != s2[i]) return false;
        return true;
    }

    public static void main(String[] args) {
        System.out.println(isAnagram(a, b));
    }

    static String a = "";
    static String b = "";
}
